import React, {Component} from 'react'
import bg_img from './mock-up-images/Dashboard BG.svg'
import Header from './mock-up-images/header.svg'

class header extends Component {
    // State 
    state = {}

    // Render 
    render () {
        return (
            <React.Fragment>
                {/* BackGround */}
                <img src={bg_img} style={{
                    "maxWidth":"100%", 
                    "maxHeight":"100%", 
                    "zIndex":"1",                     
                }} className="mb-5"/>
                {/* Header */}
                <img src={Header} style={{
                    "maxWidth":"100%", 
                    "maxHeight":"100%",
                    "zIndex":"2",
                    "position":"absolute"
                }}/>
            </React.Fragment>
        )
    }
}

export default header
